import React from 'react'
import './Navbar.css'
export const Navbar = () => {
  return (
    <div>
         <div class="nav-bar">
        <img src="./assets/istockphoto-1191918617-612x612-removebg-preview.png" alt="logo" class="logo"/>
        <ul class="nav-element" style="list-style-type: none;">
        <li><a href="#">Home</a></li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <li><a href="#">About</a></li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <li><a href="#">Profile</a></li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <li id="login"><a href="./../Harshal/index.html">Login</a></li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <li id="signup"><a href="./../Hardik/index.html">Sign Up</a></li>
        </ul>
    </div>
    </div>
  )
}
